@namespace url(http://www.w3.org/1999/xhtml);

@-moz-document url-prefix(http://www.google.) {

  body {
    font-family:verdana !important;
    margin-top:15% !important;
    background:black !important;
    color:white !important;
    font-size:10px !important;
    border-collapse:collapse !important;
  }

  div, td {
    color:#a0a0a0 !important;
  }

  input {
    border:solid 1px #909090 !important;
    margin:1px !important;
    font-size:10px !important;
  }

  input[type=radio] {
    width:auto !important;
  }

  input[type=submit] {
    width:202px !important;
    text-align:center !important;
    background:#202020 !important;
    color:#a0a0a0 !important;
  }

  input[name=q] {
    background:#181818 !important;
    color:#b8b8b8 !important;
    padding:2px 5px !important;
    width:406px !important;
  }

  label {
    color:#a0a0a0 !important;
    font-size:10px !important;
  }

  a {
    color:#ff7700 !important;
    text-decoration:none !important;
  }

  body a:hover {
    text-decoration:underline !important;
  }

  a.q {
    color:#ff7700 !important;
    text-decoration:none !important;
    font-size:10px !important;
  }

  font > b {
    font-size:10px !important;
  }

  body > center > font, body > center > div > font[size='-1'], body > div > font[size='-1'] {
   font-size:9px !important;
  }

  img[src="/intl/en/images/logo.gif"], img[alt="Google"][height="110"][width="276"] {
    width: 0 !important;
    height: 110px !important;
    padding-left: 276px !important;
  }

  img[src="/intl/en/images/logo.gif"], img[alt="Google"][height="110"][width="276"], body > center > div[style][align=left] {
    background-image: url("data:image/gif;base64,") !important;
  }

  img[src="images/hp0.gif"] {
    width: 0 !important;
    height: 78px !important;
    padding-left: 158px !important;
    background-image: url("data:image/gif;base64,");
  }

  img[src="images/hp1.gif"] {
    width: 0 !important;
    height: 78px !important;
    padding-left: 50px !important;
    background-image: url("data:image/gif;base64,")
  }

  img[src="images/hp3.gif"] {
    width: 0 !important;
    height: 32px !important;
    padding-left: 50px !important;
    background-image: url("data:image/gif;base64,")
  }

  img[src="images/hp2.gif"] {
    width: 0 !important;
    height: 78px !important;
    padding-left: 68px !important;
    background-image: url("data:image/gif;base64,")
  }

  body > center > p > font, body > center > center > center > p > font, body > form > center > font > font, body > center > table font {
    color:#a0a0a0 !important;
    font-size:10px !important;
  }
}

@-moz-document url-prefix(http://www.google.pl/search),
               url-prefix(http://www.google.pl/swr),
               url-prefix(http://www.google.pl/advanced_search),
               url-prefix(http://www.google.pl/language_tools),
               url-prefix(http://www.google.pl/preferences),
               url-prefix(http://www.google.pl/custom),
               url-prefix(http://www.google.com/search),
               url-prefix(http://www.google.com/swr),
               url-prefix(http://www.google.com/advanced_search),
               url-prefix(http://www.google.com/language_tools),
               url-prefix(http://www.google.com/preferences),
               url-prefix(http://www.google.com/custom) {

  body {
    margin-top:0px !important;
  }

  .g {
    margin-left:10% !important;
  }

  .g a.l {
    font-size:12px !important;
  }

  .g td.j {
    border-top:solid 1px #303030 !important;
  }

  .g font {
    color:#a0a0a0 !important;
    font-size:11px !important;
  }

  .g font > b, .t b {
    color:#f0b000 !important;
    font-weight:normal !important;
    font-size:11px !important;
  }

  .g font > font {
    color:#008000 !important;
  }

  .t > tbody > tr > td > font {
    padding-top:3px !important;
    padding-bottom:1px !important;
    font-size:10px !important;
  }

  .g .r {
    border-bottom:none !important;
  }

  [bgcolor='#e5ecf9'], td.t {
    background:#303030 !important;
  }

  [bgcolor='#3366cc'], td.k {
    background:#aa5500 !important;
  }

  [bgcolor='#e5ecf9'] font, td.t font {
    color:#909090 !important;
    font-size:10px !important;
  }

  [bgcolor='#e5ecf9'] font > * {
    font-size:10px !important;
  }

  [bgcolor='#e5ecf9'] font > b {
    color:#aa5500 !important;
  }

  .t {
    background:#303030 !important;
    color:#666 !important;
  }

  .bb {
    border-bottom:1px solid #aa5500 !important;
  }

  .bt {
    border-top:1px solid #aa5500 !important;
  }

  div#navbar * {
    font-size:12px !important;
  }

  /* comment this stanza out to have the sponsored links visible */
  table[bgcolor='#ffffff'][align='right'], div.ch {
    visibility:hidden !important;
    position:absolute !important;
  }

  font[face='arial,sans-serif'][color='green'] b {
    font-size:12px !important;
    color:#008000 !important;
  }

  table[width='100%'] font[face='arial,sans-serif'] {
    color:#b0b0b0 !important;
    font-size:12px !important;
  }

  table[width='100%'] font[face='arial,sans-serif'] b {
    color:#cc6600 !important;
    font-weight:normal !important;
    font-size:12px !important;
  }

  [bgcolor='#ffffff'], [bgcolor='#fff'] {
    background:#202020 !important;
  }

  body[bgcolor='#ffffff'] {
    background:#000 !important;
  }

  [bgcolor='#cbdced'] {
    background:#402000 !important;
  }

  [bgcolor='#cbdced'] font > b {
    font-size:12px !important;
  }

/* --- Modifications for GooglePedia --------------------------------------- */
  div#wikibox {
    background:#202020 !important;
    border-top:solid 1px #603000 !important;
    border-bottom:solid 1px #603000 !important;
    padding:3px !important;
  }

  div#wikibox * {
    font-size:10px !important;
    line-height:normal !important;
  }

  div#wikibox h1, div#wikibox h1 * {
    font-size:18px !important;
    font-weight:bold !important;
  }

  div#wikibox h2, div#wikibox h2 * {
    font-size:14px !important;
    font-weight:bold !important;
  }

  div#wikibox h3, div#wikibox h3 * {
    font-size:12px !important;
    font-weight:bold !important;
  }

  div#wikibox h4, div#wikibox h4 * {
    font-size:11px !important;
    font-weight:bold !important;
  }

  div#wikibox h5, div#wikibox h5 * {
    font-size:10px !important;
    font-weight:bold !important;
  }

  div#wikibox h3#siteSub {
    font-size:9px !important;
    font-weight:bold !important;
  }

  div#wikibox h1, div#wikibox h2, div#wikibox h3, div#wikibox h4, div#wikibox h5, div#wikibox h1 span, div#wikibox h2 span, div#wikibox h3 span, div#wikibox h4 span, div#wikibox h5 span {
    color: #a0a0a0 !important;
  }

  div#wikibox.shrunk {
    border-left:solid 3px #603000 !important;
  }

  div#wikibox .thumb {
    background:#202020 !important;
    border:solid 1px #202020 !important;
  }

  div#wikibox .tright, div#wikibox .tleft/*, div#wikibox .noprint*/, div#wikibox #ograniczenia, div#wikibox #Vorlage_Alternative, div#wikibox #catlinks, div#wikibox .infobox, div#wikibox .toccolours, div#wikibox [style*="background: rgb(249, 249, 249)"] {
    background:#303030 !important;
    border:solid 1px #804000 !important;
  }

  div#wikibox .infobox caption {
    color: #a0a0a0 !important;
  }

  div#wikibox .thumb *, div#wikibox [bgcolor="#efefef"] {
    background:#303030 !important;
    border: 0px !important;
  }

  div#wikibox .navHead, div#wikibox [style*="background-color: lightblue"], div#wikibox [style*="background: rgb(204, 204, 255)"] {
    background:#304040 !important;
    color: #a0a0a0 !important;
    font-weight: bold !important;
  }

  div#wikibox div[style*="background: rgb(255, 255, 221)"] {
    background:#202000 !important;
    border:solid 1px #804000 !important;
  }

  div#wikibox [style='text-align: center; background-color: rgb(229, 229, 229);'] {
    background:#202020 !important;
  }

  div#wikibox #toc {
    background:#181818 !important;
    border:solid 1px #402000 !important;
  }

  div#wikibox #toc * {
    font-size:10px !important;
  }

  div#wikibox #toc h2 {
    font-size:12px !important;
  }

/* --- End of GooglePedia Modifications ------------------------------------ */

  img[src="/images/logo_sm.gif"] {
    width:0px !important;
    height:55px !important;
    padding-left:150px !important;
  }

  img[src="/images/logo_sm.gif"], #logo span {
    background: url("data:image/png;base64,") !important;
  }

  img[src*="nav_previous.gif"] {
    width:0px !important;
    height:26px !important;
    padding-left:68px !important;
  }

  img[src*="nav_previous.gif"], div#np {
    background: url("data:image/gif;base64,") -23px 0px !important;
  }

  img[src*="nav_first.gif"] {
    width:0px !important;
    height:26px !important;
    padding-left:18px !important;
  }

  img[src*="nav_first.gif"], div#nf {
    background-position: 0px !important;
    background-image: url("data:image/gif;base64,") !important;
  }

  img[src*="nav_page.gif"], img[src*="nav_current.gif"] {
    width:0px !important;
    height:26px !important;
    padding-left:16px !important;
  }

  img[src*="nav_page.gif"], div.nr {
    background-position: 0px !important;
    background-image: url("data:image/gif;base64,") !important;
  }

  img[src*="nav_current.gif"], div#nc {
    background-position: 0px !important;
    background-image: url("data:image/gif;base64,") !important
  }

  img[src*="nav_next.gif"] {
    width:0px !important;
    height:26px !important;
    padding-left:100px !important;
  }

  img[src*="nav_next.gif"], div#nn {
    background-position: 0px !important;
    background-image: url("data:image/gif;base64,") !important;
  }

  img[src*="nav_last.gif"] {
    width:0px !important;
    height:26px !important;
    padding-left:46px !important;
  }

  img[src*="nav_last.gif"], div#nl {
    background-position: 0px !important;
    background-image: url("data:image/gif;base64,") !important;
  }

  center > font.p {
    color:#a0a0a0 !important;
  }
}
